@Component({
  selector: 'app-sidenav',
  templateUrl: './sidenav.component.html',
  styleUrls: ['./sidenav.component.css']
})
export class SidenavComponent {
  list =[
    {
      number:'1',
      name:'Home',
      icon:'fa-solid fa-house'
    },
    {
      number:'2',
      name:'Doctor',
      icon:'fa-solid fa-user-doctor'
    },
    {
      number:'3',
      name:'Patient',
      icon:'fa-solid fa-bed'
    }

  ]
}
